import ReactDOM from "react-dom/client";
import Header from "../src/components/Header";
import App from "./routes/App";
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <Header />
    <App />
  </React.StrictMode>
);
